import React, { FunctionComponent, useState, useEffect } from 'react';
import Skin from './models/skin';
import SKINS from './models/mock-skins';

const App: FunctionComponent = () => {
    const [skins, setSkins] = useState<Skin[]>(SKINS);

    useEffect(() => {
        setSkins(SKINS);
    }, []);

    return (
        <div className='absolute t50'>
            <h1>il y a {skins.length} skins</h1>

            <ul>
                {skins.map((skin) => (
                    <li>
                        <p key={skin.id}>id : {skin.id}</p>
                        <p key={skin.classe}>classe : {skin.classe}</p>
                        <img key={skin.picture} src={skin.picture}></img>
                        <div>
                            {skin.color.map(color => (
                                <p>{color}</p>
                            ))}
                        </div>
                        <div>
                            {skin.object.map(obj => (
                                <p>{obj}</p>
                            ))}
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default App;
